function moverJugadorEquipoCorrespondiente(player){
	const players = room.getPlayerList();

  	// Filtrar jugadores activos para saber quienes estan jugando.
  	const activePlayers = players.filter(player => !player.spectator);

  	const team1Players = activePlayers.filter(player => player.team === 1);
    const team2Players = activePlayers.filter(player => player.team === 2);
	
	if(team1Players.length > team2Players.length){
		room.setPlayerTeam(player.id, 2);
		
	}else if(team1Players.length < team2Players.length){
		room.setPlayerTeam(player.id, 1);
	}else{
		// Elegir aleatoriamente a qu√© equipo poner al jugador.
		const randomTeam = Math.random() < 0.5 ? 1 : 2;
		room.setPlayerTeam(player.id, randomTeam);	
	}
}
//bandera afk


const lastAfkUsage = {};
const afkCooldown = 30000; // 30 segundos en milisegundos
const afkToGameCooldown = 60000; // 1 minuto en milisegundos

function afkFun(player, message) { // !classic
  if (afkPlayerIDs.has(player.id)) {
    // Si el jugador ya est√° en modo AFK, se verifica si ha pasado el tiempo suficiente para volver a la partida
    const currentTime = Date.now();
    const lastUsageTime = lastAfkUsage[player.id] || 0;
    const timeSinceLastUsage = currentTime - lastUsageTime;

    if (timeSinceLastUsage >= afkToGameCooldown) {
      afkPlayerIDs.delete(player.id);
      room.setPlayerTeam(player.id, 1); // Se asume que el equipo rojo es el equipo 1, puedes ajustarlo seg√∫n tu c√≥digo
      room.sendAnnouncement("‚Ü© " + player.name + " volvi√≥! üéÆ", null, 0x00FFBB, "normal", 0);
      // Puedes agregar aqu√≠ cualquier otra acci√≥n que desees realizar cuando el jugador vuelva a la partida
    } else {
      const secondsLeft = Math.ceil((afkToGameCooldown - timeSinceLastUsage) / 1000);
      // El tiempo de enfriamiento a√∫n no ha pasado, por lo que no se permite volver a la partida.
      room.sendAnnouncement("¬°Espera un momento antes de volver a la partida! " + secondsLeft + " segundos restantes", player.id, 0xF9F264, 'normal', 2);
    }
  } else {
	room.sendAnnouncement("entro aca");
    // Si el jugador no est√° en modo AFK, se verifica si ha pasado un tiempo m√≠nimo desde la √∫ltima vez que us√≥ el comando !afk
    const currentTime = Date.now();
    const lastUsageTime = lastAfkUsage[player.id] || 0;
    const timeSinceLastUsage = currentTime - lastUsageTime;

    if (timeSinceLastUsage >= afkCooldown) {
      afkPlayerIDs.add(player.id);
      room.setPlayerTeam(player.id, 0);
      room.sendAnnouncement("[üí§] " + player.name + " se encuentra ùêÄùêÖùêä ‚ùó ‚åõ ", null, 0xff8400, 'normal', 2);
      room.sendAnnouncement("[üí§]  Para volver a la partida usa !afk", player.id, 0xff8400, 'normal', 2);

      // Registra el tiempo actual como la √∫ltima vez que us√≥ el comando !afk
      lastAfkUsage[player.id] = currentTime;
    } else {
      const secondsLeft = Math.ceil((afkCooldown - timeSinceLastUsage) / 1000);
      // El tiempo de enfriamiento a√∫n no ha pasado, por lo que no se permite usar el comando !afk nuevamente.
      room.sendAnnouncement("¬°Espera un momento antes de volver a usar !afk! " + secondsLeft + " segundos restantes", player.id, 0xF9F264, 'normal', 2);
    }
  }
}


