// Funci√≥n para reemplazar los n√∫meros con emojis en negrita
function replaceNumbers(number) {
	const replacements = {
		0: "0Ô∏è‚É£",
		1: "1Ô∏è‚É£",
		2: "2Ô∏è‚É£",
		3: "3Ô∏è‚É£",
		4: "4Ô∏è‚É£",
		5: "5Ô∏è‚É£",
		6: "6Ô∏è‚É£",
		7: "7Ô∏è‚É£",
		8: "8Ô∏è‚É£",
		9: "9Ô∏è‚É£"
	};

	return number.toString().replace(/\d/g, match => replacements[match]);
}

